  {comment_id: "5294819", shots_id: nil, comment_created_at: "2016-05-24T15:43:34Z", body: "<p>This is sweet man! I'm with <a href=\"https://dribbble.com/6187\">@Dapper Studio</a> on that R though. It's pretty solid on the larger version, but when you look at it in the smaller version it reads \"Capne\". </p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/48609/avatars/normal/grizz_circle_icon.png?1396206385", user_id: "48609", user_name: "Jeremy Richie"},
  {comment_id: "5294957", shots_id: nil, comment_created_at: "2016-05-24T16:29:08Z", body: "<p>Never make it easy on yourself!</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/216473/avatars/normal/d481a481b8914ce58264caae19e69b60.png?1455554915", user_id: "216473", user_name: "Joshua Mayfield"},
  {comment_id: "5295156", shots_id: nil, comment_created_at: "2016-05-24T17:28:00Z", body: "<p>Fair point about the 'r' <a href=\"https://dribbble.com/6187\">@Dapper Studio</a> - I was questioning it myself more than any other character in the whole alphabet I created. I have a few ideas for an alternate that may solve the issue of it being potentially perceived as a 'p'. Glad you guys are liking it otherwise, it definitely still needs some refinement/tweaking, thanks for the feedback guys.</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/42095/avatars/normal/JCAvatar.png?1391630497", user_id: "42095", user_name: "Jason Carne"},
  {comment_id: "5295286", shots_id: nil, comment_created_at: "2016-05-24T18:18:02Z", body: "<p><a href=\"https://dribbble.com/6187\">@Dapper Studio</a> <a href=\"https://dribbble.com/48609\">@Jeremy Richie</a> - Alternate 'r' uploaded in a new attachment here - I think it loses a bit of the personality in the character, but it definitely reads better at smaller sizes. I may have to play with it a bit more to find a nice mid-ground.</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/42095/avatars/normal/JCAvatar.png?1391630497", user_id: "42095", user_name: "Jason Carne"},
  {comment_id: "5295309", shots_id: nil, comment_created_at: "2016-05-24T18:31:22Z", body: "<p>This is looking suuuper good Jason. You could try adding a little extra space between the stem of the 'r' and the terminal. I do like how it loops back in on itself, it may just need some extra breathing room.</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/590268/avatars/normal/040553518e3b0dda641d7d075085c5e5.jpg?1422912382", user_id: "590268", user_name: "Mike Burroughs"},
  {comment_id: "5295435", shots_id: nil, comment_created_at: "2016-05-24T19:16:26Z", body: "<p><a href=\"https://dribbble.com/42095\">@Jason Carne</a> it does lose a bit of that character at the larger size. I guess it really depends on your frequent application. You could always just use JC as and icon sized application. </p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/48609/avatars/normal/grizz_circle_icon.png?1396206385", user_id: "48609", user_name: "Jeremy Richie"},
  {comment_id: "5295603", shots_id: nil, comment_created_at: "2016-05-24T20:30:47Z", body: "<p>I prefer the less ornamented \"r.\"</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/3785/avatars/normal/sbh-avatar-february-2014-800x800.jpg?1395428513", user_id: "3785", user_name: "Simon H."},
  {comment_id: "5295658", shots_id: nil, comment_created_at: "2016-05-24T20:53:10Z", body: "<p><a href=\"https://dribbble.com/42095\">@Jason Carne</a> I personally prefer the alternate 'r' because of readability. Killer work either way!</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/6187/avatars/normal/834a81cf1e279fc3412fb8e8de8952ac.jpg?1447693534", user_id: "6187", user_name: "Dapper Studio"},
  {comment_id: "5295684", shots_id: nil, comment_created_at: "2016-05-24T21:00:13Z", body: "<p>I think the less ornamented r as well, reads more like an 'R'. Great work man!</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/292238/avatars/normal/89d22cc60921880b37daf9e830e9c35c.png?1459434827", user_id: "292238", user_name: "Justin Rands"},
  {comment_id: "5295954", shots_id: nil, comment_created_at: "2016-05-24T22:16:40Z", body: "<p>To me the J feels a bit unfinished as is, possibly because it's the only letter without the stencil motif. Have you tried any alternate versions for the J?</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/148441/avatars/normal/1c762f4008098d3378d7c54bc96eb2e6.jpg?1433203640", user_id: "148441", user_name: "Winston Scully"},
  {comment_id: "5295577", shots_id: nil, comment_created_at: "2016-05-24T20:24:00Z", body: "<p>This is lovely! I wonder if upping the stroke thickness on the linework wouldn't give it more intensity. Like, bring it to the level of the ECG lines maybe?</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/3785/avatars/normal/sbh-avatar-february-2014-800x800.jpg?1395428513", user_id: "3785", user_name: "Simon H."},
