  {comment_id: "5295280", shots_id: nil, comment_created_at: "2016-05-24T18:17:00Z", body: "<p>üôåüî•üå≤</p>\n\n<p>Love me some <a href=\"https://dribbble.com/shots/2523264--I-don-t-talk-to-the-other-lookouts-as-much-as-I-talk-to-you\" rel=\"nofollow noreferrer\">Firewatch</a>.</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/56251/avatars/normal/cee591fe8b85098cc248cf4fdbf31cba.png?1458859831", user_id: "56251", user_name: "Noah Jacobus"},
  {comment_id: "5295871", shots_id: nil, comment_created_at: "2016-05-24T21:50:14Z", body: "<p>Beautiful. It reminds me of Firewatch as well.</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/1170981/avatars/normal/65e93e44c98b9977cd076660d4ffe95e.jpg?1463070461", user_id: "1170981", user_name: "The Cerbis"},
