  {comment_id: "5296047", shots_id: nil, comment_created_at: "2016-05-24T23:49:12Z", body: "<p>Definitely hot <a href=\"https://dribbble.com/73492\">@Martin Azambuja</a>. Killer icons and love the effect with the lines under the \"A\". Great feel and look.</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/119045/avatars/normal/98ff1f01672c62e92ccdf3b9fcbb01e9.jpg?1440510720", user_id: "119045", user_name: "Sara D√°vila Evangelista"},
  {comment_id: "5294606", shots_id: nil, comment_created_at: "2016-05-24T15:01:46Z", body: "<p>In color, it works well. But in two color or purple only, The letter \"i\" is lost IMO.</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/104548/avatars/normal/e4e942e8dd14e7918a54d95d6e2f0507.jpg?1409166165", user_id: "104548", user_name: "Maxime Gigu√®re"},
  {comment_id: "5294635", shots_id: nil, comment_created_at: "2016-05-24T15:06:44Z", body: "<p>Hey <a href=\"https://dribbble.com/104548\">@Maxime</a> thank you for your feedback! </p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/78433/avatars/normal/a2841067c1238ebb9956316f69c01f55.png?1444226009", user_id: "78433", user_name: "Jeroen van Eerden"},
  {comment_id: "5294748", shots_id: nil, comment_created_at: "2016-05-24T15:22:48Z", body: "<p><a href=\"https://dribbble.com/104548\">@Maxime Gigu√®re</a> OOOoooh only because of your comment did I realize the \"I\" was the stem of the \"b\" - I thought it was a small \"i\" from the stem of then \"n\" </p>\n\n<p>I kept reading \"i b\" though.</p>\n\n<p>Interesting idea though, I think it's a great start, just might need some tweaking to get the full \"NIB\" through</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/8931/avatars/original/baltes_penguin.png?1346694548", user_id: "8931", user_name: "Andy Baltes"},
  {comment_id: "5294877", shots_id: nil, comment_created_at: "2016-05-24T15:59:11Z", body: "<p><a href=\"https://dribbble.com/8931\">@Andy Baltes</a> It is interesting to have different perception! But like you said, it is a great start! I will follow the evolution for sure!</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/104548/avatars/normal/e4e942e8dd14e7918a54d95d6e2f0507.jpg?1409166165", user_id: "104548", user_name: "Maxime Gigu√®re"},
  {comment_id: "5295014", shots_id: nil, comment_created_at: "2016-05-24T16:37:35Z", body: "<p><a href=\"https://dribbble.com/8931\">@Andy Baltes</a> thank you for your feedback. I agree on the 'i' that might be a little hard to spot here. Will work on that. </p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/78433/avatars/normal/a2841067c1238ebb9956316f69c01f55.png?1444226009", user_id: "78433", user_name: "Jeroen van Eerden"},
  {comment_id: "5295060", shots_id: nil, comment_created_at: "2016-05-24T16:51:48Z", body: "<p>I really like the geometry, but yeah - I'm personally not getting nib from it easily - I'm reading nb, ib, maybe even rb first.</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/249838/avatars/normal/aa477b940b889c3c5ff5996112f0d412.jpg?1441067599", user_id: "249838", user_name: "Jeff Thomson"},
  {comment_id: "5295594", shots_id: nil, comment_created_at: "2016-05-24T20:28:41Z", body: "<p><a href=\"https://dribbble.com/249838\">@Jeff Thomson</a> the 'i' could be the most less obvious letter to spot here. I've been exploring within this concept and made some minor adjustments. Hope to share more soon. Cheers for helping me explore this concept. </p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/78433/avatars/normal/a2841067c1238ebb9956316f69c01f55.png?1444226009", user_id: "78433", user_name: "Jeroen van Eerden"},
  {comment_id: "5295688", shots_id: nil, comment_created_at: "2016-05-24T21:00:30Z", body: "<p>Very cool exploration. I read it more as \"mb\" perhaps because the tittle (hee hee) on the \"i\" is not clear enough. It seems that you could increase the space between the bottom and top part of the \"i\" while still preserving its other identity as part of the stem of the \"b\". This extra space could also help in making the \"n\" more clear, even. In the end, I will still wonder if it's truly readable as a monogram, but there's no doubt that it's elegant. This exact property could work to its advantage, though, if it becomes paired with the actual words signified by \"N.I.B.\" (if it even stands for something)--because the letterforms are abstracted enough, it wouldn't look redundant like a normal acronym might. That was a mouthful haha. Inspiring work, man!</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/486065/avatars/normal/7987e4e9162faad63fb5aa4252f7df31.jpg?1460408271", user_id: "486065", user_name: "Jack Christie"},
