  {comment_id: "5296951", shots_id: nil, comment_created_at: "2016-05-25T09:22:48Z", body: "<p>With the exception of the jets which seem to have a little easing, the end of the animation of the moving parts feels very abrupt. I‚Äôd question whether the animations should stop at all though, it feels strange watching the birds freeze mid-flight.</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/105143/avatars/normal/b84b4972e74e4bff13c933ee377aa6a1.png?1461671774", user_id: "105143", user_name: "Elliot Jackson"},
  {comment_id: "5296961", shots_id: nil, comment_created_at: "2016-05-25T09:25:26Z", body: "<p>Agree with Elliot. I'd let those moving elements flow all the way through rather then stopping in the middle of each image.</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/3793/avatars/original/beneklisefski.jpg?1338525622", user_id: "3793", user_name: "Benek Lisefski"},
  {comment_id: "5296967", shots_id: nil, comment_created_at: "2016-05-25T09:26:50Z", body: "<p>Thanks for your comment <a href=\"https://dribbble.com/105143\">@Elliot Jackson</a>, an animation should pause at some moment to give a user  chance to read a text without any distraction, maybe there could be some very subtle movement, we'll test it out, thanks for a good point.</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/25514/avatars/normal/070810be04e642201206c8fbdffcbf8a.png?1455536235", user_id: "25514", user_name: "Ramotion"},
  {comment_id: "5296971", shots_id: nil, comment_created_at: "2016-05-25T09:27:18Z", body: "<p><a href=\"https://dribbble.com/3793\">@Benek Lisefski</a> Thanks for your comment man</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/25514/avatars/normal/070810be04e642201206c8fbdffcbf8a.png?1455536235", user_id: "25514", user_name: "Ramotion"},
  {comment_id: "5296973", shots_id: nil, comment_created_at: "2016-05-25T09:27:36Z", body: "<p>Nice illustration!\n<br />By the way how to skip this onboarding process?  I don't see any button here\n</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/179827/avatars/normal/ad80beae1f5a6872fde6fff6fcb350bd.jpg?1463807484", user_id: "179827", user_name: "Afnizar Nur Ghifari"},
  {comment_id: "5296987", shots_id: nil, comment_created_at: "2016-05-25T09:31:32Z", body: "<p><a href=\"https://dribbble.com/179827\">@Afnizar Nur Ghifari</a> That's right, there's no skip button in this onboarding, thanks for your comment :) </p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/25514/avatars/normal/070810be04e642201206c8fbdffcbf8a.png?1455536235", user_id: "25514", user_name: "Ramotion"},
  {comment_id: "5297000", shots_id: nil, comment_created_at: "2016-05-25T09:36:28Z", body: "<p><a href=\"https://dribbble.com/25514\">@Ramotion</a> I don‚Äôt disagree. The options here in my opinion are animate in and through the view but don‚Äôt animate any other elements in as the others leave, find a different style of animation that works better for this use case or don‚Äôt animate at all. If all it is doing it feeling odd and distracting the user then the animation isn‚Äôt adding anything to the flow, it is just animation for animations sake.</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/105143/avatars/normal/b84b4972e74e4bff13c933ee377aa6a1.png?1461671774", user_id: "105143", user_name: "Elliot Jackson"},
