  {comment_id: "5297021", shots_id: nil, comment_created_at: "2016-05-25T09:43:11Z", body: "<p>I really enjoy the little animations in the illustration :D amazing work <a href=\"https://dribbble.com/25514\">@Ramotion</a> </p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/957817/avatars/normal/7856186a8796ebbdcd1beb6a15628dfe.jpg?1444868307", user_id: "957817", user_name: "Lorenzo Perniciaro"},
  {comment_id: "5297024", shots_id: nil, comment_created_at: "2016-05-25T09:43:58Z", body: "<p><a href=\"https://dribbble.com/105143\">@Elliot Jackson</a> Good points, thanks for your advise</p>", user_avatar_url: "https://d13yacurqjgara.cloudfront.net/users/25514/avatars/normal/070810be04e642201206c8fbdffcbf8a.png?1455536235", user_id: "25514", user_name: "Ramotion"},
