  {title: "GIF Animation for  Recipes and Cooking", description: "<p>Hello guys!</p>\n\n<p>Nice to get in touch with all of you again! Summer is right behind the corner so days are full of sunny light and bright colors. Getting inspired, I'd like to share my new animated shot. This is a design concept for the recipe application. With it, users can add recipes to their collections or find the ones online, categorize and organize their recipe books and categories, form menus and shopping plans. So, here you can see some interactions livened with motion design. They feature the process when the user is choosing the item from the list of categories and then from the list of particular recipes in one category. The implementation of the concept will be soon available free at <strong>GitHub.</strong></p>\n\n<p><strong> Here in <a href=\"http://tubikstudio.com\" rel=\"nofollow noreferrer\">Tubik Studio</a> we constantly broaden our professional horizons practicing and working over diverse projects, new design tasks on UI/UX, branding and animation as well as sharing our ideas, experience and recommendations in <a href=\"http://tubikstudio.com/blog/\" rel=\"nofollow noreferrer\">Tubik Blog</a>. Don't miss the latest <a href=\"http://tubikstudio.com/blog/case_study/\" rel=\"nofollow noreferrer\">design case studies</a>  focused on design process providing user-friendly and efficient solutions. Stay tuned! </strong></p>\n\n<p><a href=\"https://www.behance.net/Tubik\" rel=\"nofollow noreferrer\">Behance</a> | <a href=\"http://instagram.com/tubikstudio\" rel=\"nofollow noreferrer\">Instagram</a> | <a href=\"https://twitter.com/tubikstudio\" rel=\"nofollow noreferrer\">Twitter</a> | <a href=\"https://www.facebook.com/tubikstudio\" rel=\"nofollow noreferrer\">Facebook</a> | <a href=\"https://plus.google.com/+Tubikstudio\" rel=\"nofollow noreferrer\">Google+</a> | <a href=\"http://tubikstudio.com/\" rel=\"nofollow noreferrer\">Tubik</a></p>", width: "400", height: "300", tags: "[\"